import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { AuthpagesComponent } from './pages/authpages/authpages.component';



@NgModule({
  declarations: [
    AuthpagesComponent
  ],
  imports: [
    CommonModule
  ]
})
export class AuthModule { }
